import "./App.css";
import { Route, Routes } from "react-router-dom";
import Template from "./components/main/MainTemplate";
import LoginPage from "./components/auth/LoginPage";
import JoinPage from "./components/auth/JoinPage";
import CreditsTemplate from "./components/credits/CreditsTemplate";
import client from "./components/auth/api/client";

export const join = ({ userName, userId, password }) =>
    client.post('/api/join', { name: userName, id: userId, pwd: password }).then(function (response) {
        console.log(response);
        return response;
    }).catch(function (error) {
        console.log(error);
        /*
        console.log(error.response.status);
        if(error.response.status===409)
            return -1;
            */
        return error;

    });

function App() {
  return (
    <Routes>
      <Route path="/" element={<Template />} />
      <Route path="/login" element={<LoginPage />} />
      <Route path="/join" element={<JoinPage />} />
      <Route path="/credits" element={<CreditsTemplate />} />
    </Routes>
  );
}

export default App;
